import React, { Component } from "react";


class AddRecipe extends Component {
    handleSubmit = event => {
        event.preventDefault();

        console.log("clicked");
    }
    render(){
        return(
            <>
            <form>
                <h2>Add a recipe</h2>
                <label for="recipeName">Recipe Name:</label>
                <input type="text" name="recipeName"></input>
                <label>Ingredients:

                </label>
                <input type="text" name="ingredients"></input>
                <label>Directions:
                    <input type="text" name="directions"></input>
                </label>
                <button type="submit" id="submit" onClick={this.handleSubmit}>Submit</button>
            </form>
            </>
        )
    }
}

export default AddRecipe;
